/*global chrome*/
import React from 'react';
import './App.css';

class App extends React.Component {
  componentDidMount() {
    chrome.tabs.query({ active: true, currentWindow: true }, (tabs) => {
      chrome.tabs.sendMessage(tabs[0].id, { openSidebar: true });
    });
  }

  render() {
    return (
      <div>
        <h1>Hello World!</h1>
      </div>
    );
  }
}

export default App;
